text:'{"blocks":[{"key":"tlel","text":"What should you as a congregation member consider before accepting or rejecting this potential pastor? What would you vote - to accept or reject this candidate?","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":160,"style":"opacity:1"},{"offset":0,"length":160,"style":"hlnke:true"},{"offset":0,"length":160,"style":"backgroundColor:unset"},{"offset":0,"length":160,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":160,"style":"textHighlightEnable:false"},{"offset":0,"length":160,"style":"textShadowEnable:false"},{"offset":0,"length":160,"style":"overridden:false"},{"offset":0,"length":160,"style":"hlnk:"},{"offset":0,"length":160,"style":"hlnkt:wp"},{"offset":0,"length":160,"style":"textOutlineEnable:false"}],"entityRanges":[],"data":{"presetId":"text-body-2","listDepth":"0","listType":"S_Bullets08","listIndent":"100%","listSize":"100%","listColor":"#666666","overridden":"false","verticalAlign":"middle"}},{"key":"78lsn","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{"listType":"S_Bullets08","listColor":"#666666","listIndent":"100%","listSize":"100%","verticalAlign":"middle","listDepth":"0","overridden":"false","presetId":"text-body-2"}},{"key":"do6vi","text":"Caleb Yan affirms all of PCCs doctrine and beliefs\\r\\nCaleb Yan was an ex-Harvard professor of 5 years, has an M. Div in Biblical Counseling, 12 years of experience as a youth pastor, and Ph.D.s in Theological Studies, Old Testament, and New Testament.\\r\\nCaleb Yan would prefer to leave the parents of YFers alone because he believes that he and the YF Team are far more capable at discipling the younger generation. \\r\\nCaleb Yan is the nephew of several of people who serve in PCC, and him getting rejected would upset such people greatly.\\r\\nCaleb Yan is friends with Jensen Huang, CEO of NVIDIA, who has personally agreed to quadruple the PCC budget if Caleb is hired.\\r\\nBeing an ex-Harvard professor and best friends with Jensen Huang, Caleb can personally guarantee that all YFers will be able to attend an Ivy League college and all ACFers/RISE members will receive offers for the best, highest-paying, remote tech jobs.\\r\\nWhen asked for his vision for YF lessons, Caleb said he wants to emphasize the need for YFers to be academically successful in order to have a secure and comfortable life. \\r\\n","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":1097,"style":"hlnk:"},{"offset":0,"length":1097,"style":"hlnkt:wp"},{"offset":0,"length":1097,"style":"textOutlineEnable:false"},{"offset":0,"length":1097,"style":"opacity:1"},{"offset":0,"length":1097,"style":"hlnke:true"},{"offset":0,"length":1097,"style":"backgroundColor:unset"},{"offset":0,"length":1097,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":1097,"style":"textHighlightEnable:false"},{"offset":0,"length":1097,"style":"textShadowEnable:false"},{"offset":0,"length":1097,"style":"overridden:false"}],"entityRanges":[],"data":{"presetId":"text-body-2","listDepth":"0","listType":"S_Bullets08","listIndent":"100%","listSize":"100%","listColor":"#666666","overridden":"false","verticalAlign":"middle"}}],"entityMap":{}}',
